import React from "react";

export default function Page1() {
    return (
        <div>
            <table style={{ width: '100vw', height: '100vh' }}>
                <tr>
                    <td style={{ width: '67%', backgroundColor: '#FFDEAF' }}>
                    </td>
                    <div style={{
                        position: 'absolute',
                        width: '621px',
                    height: '826px',
                    left: '960px', top: '181px'
                    }}></div>
                <td style={{ width: '33%', backgroundColor: '#EE3337' }}>
                </td>
            </tr>
        </table>
        </div >
    );
}
